(25, 1, '2022-03-10 10:06:17', '2022-03-10 09:06:17', '<!-- wp:paragraph -->\n<p>SUN TRAVEL travel agency is composed of a young and dynamic team always proposing tailor-made school trips, original and corresponding to the expectations of its customers. All our trips are carefully organized, in partnership with local service providers rigorously chosen for their knowledge of the country and their efficiency.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Tailor-made trips</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Since we are always at the service of the teacher, our programs can be modified and customized to best meet the needs of the group. We organize your trip 100% on demand. You tell us your precise expectations and together we build a program adapted to your budget and requirements.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Satisfied customers </h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The importance of understanding customer needs in order to better respond to them is essential in the tourism industry. Following the satisfaction questionnaires filled by our customers after each trip, we learn to improve the quality of our services, to be closer to the real needs of our groups, to anticipate their expectations. Many groups benefit from our services every year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'About us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2022-03-10 10:06:18', '2022-03-10 09:06:18', '', 0, 'http://localhost/Evaluation%20WDP/?page_id=25', 0, 'page', '', 0),
