INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(76, 1, '2022-03-10 13:38:12', '2022-03-10 12:38:12', '<!-- wp:paragraph -->\n<p>L’agence de voyage SUN TRAVEL est composée d’une équipe jeune et dynamique proposant toujours des voyages scolaires sur mesure, originaux et correspondant aux attentes de ses clients. Tous nos voyages sont soigneusement organisés, en partenariat avec des prestataires locaux rigoureusement choisis pour leur connaissance du pays et leur efficacité.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Voyage  sur mesure</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Puisque nous sommes toujours au service de l’enseignant, nos programmes peuvent être modifiés et personnalisés de façon à répondre au mieux aux besoins du groupe. Nous organisons à la demande votre voyage 100% sur mesure. Vous nous communiquez vos attentes précises et nous construisons ensemble un programme adapté à votre budget et à vos exigences.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Des clients satisfaits</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>L’importance de comprendre les besoins des clients afin de mieux y répondre est essentielle dans le milieu du tourisme. Suite aux questionnaires de satisfaction remplis par nos clients après chaque voyage, nous apprenons à améliorer la qualité de nos prestations, à être plus proches des besoins réels de nos groupes, d’anticiper leurs attentes. De nombreux groupes bénéficient de nos services chaque année.</p>\n<!-- /wp:paragraph -->', 'A propos', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2022-03-10 13:38:12', '2022-03-10 12:38:12', '', 10, 'http://localhost/Evaluation%20WDP/?p=76', 0, 'revision', '', 0);

